import './App.css';

const App = () => {

  const categories = [
    {
      id: 1,
      name: "Womens"
    },
  ]

  return (
    <div className='categories-container'>
      {categories.map(category => (
        <div key={`category${category.id}`} className='categoriy-container'>
            <div className='background-image'/>
            <div className="category-body-container">
            <h2>{category.name}</h2>
            <p>Shop Now</p>
      </div>
        </div>
      ))}
    </div>
  );
}

export default App;
